import React from "react";
import { connect } from "react-redux";
import { bindActionCreators } from "redux";
import logo from "./logo.svg";
import "./App.css";
import { addUserAsync } from "./redux/action";
import { render } from "react-dom";
import * as _ from "lodash";
import { StyledDiv,Image } from "./App.style";

class App extends React.Component {
  componentDidMount(props) {
    this.props.user1("value");
  }
  render() {
    console.log(this.props.characterData, "dataaaaaaa");
    const { characterData } = this.props;

    return (
      <div >
        {_.map(characterData, (val, key) => {
          return (
            <div>
              <StyledDiv>
              <Image src={val.image}></Image>
                <div>NAME:{val.name}</div>
                <div>STATUS:{val.status}</div>
                <div>SPECIES:{val.species}</div>
                <div>GENDER:{val.gender}</div>
                <div>ORIGIN:{val.origin.name}</div>
                <div>LAST LOCATION:{val.location.name}</div>
              </StyledDiv>
            </div>
          );
        })}
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    characterData: state && state.users
  };
};
const mapDispatchToProps = dispatch => {
  return {
    user1: value => dispatch(addUserAsync(value))
  };
};
export default connect(mapStateToProps, mapDispatchToProps)(App);
